  colorWhenUsedForHoursAndMinutes:      'rgb(150, 120, 182)', // lavender purple
  colorWhenUsedForHours :               'rgb(255,102,102)',   // coral pink
  colorWhenUsedForMinutes:              'rgb(0,128,128)',     // Teal blue
  colorWhenNotUsed:                     'rgb(255, 204, 0)',   // golden yellow
  clockBackGroundColorArrayStartColor:  'rgb(255,102,102)',   // coral pink
  clockBackGroundColorArrayEndColor:    'rgb(0, 128, 64)',    // Emerald Green
  secondsCounterArrayStartColor:        'rgb(0, 128, 64)',    // Emerald Green
  secondsCounterArrayEndColor:          'rgb(228, 0, 171)'     // pink
}
